/*********************************************************************
*
*       _FSTest
*/
static void _FSTest(void) {
  FS_FILE    * pFile;
  unsigned     Len;
  const char * sInfo = "This sample based on the Segger emUSB software with MSD component.\r\nFor further information please visit: www.segger.com\r\n";

  Len = strlen(sInfo);
  if (FS_IsLLFormatted("") == 0) {
    FS_X_Log("Low level formatting");
    FS_FormatLow("");          /* Erase & Low-level  format the volume */
  }
  if (FS_IsHLFormatted("") == 0) {
    FS_X_Log("High level formatting\n");
    FS_Format("", NULL);       /* High-level format the volume */
  }
  pFile = FS_FOpen("Readme.txt", "w");
  FS_Write(pFile, sInfo, Len);
  FS_FClose(pFile);
  FS_Unmount("");
}

/*********************************************************************
*
*       _AddMSD
*
*  Function description
*    Add mass storage device to USB stack
*
*  Notes:
*   (1)  -   This examples uses the internal driver of the file system.
*            The module initializes the low-level part of the file system if necessary.
*            If FS_Init() was not previously called, none of the high level functions
*            such as FS_FOpen, FS_Write etc will work.
*            Only functions that are driver related will be called.
*            Initialization, sector read/write, retrieve device information.
*            The following members of the DriverData are used as follows:
*              DriverData.pStart       = Index no. of the volume that shall be used.
*              DriverData.NumSectors   = Number of sectors to be used - 0 means auto-detect.
*              DriverData.StartSector  = The first sector that shall be used.
*              DriverData.SectorSize will not be used.
*/
static void _AddMSD(void) {
  static U8 _abOutBuffer[USB_MAX_PACKET_SIZE];
  USB_MSD_INIT_DATA     InitData;
  USB_MSD_INST_DATA     InstData;

  InitData.EPIn  = USBD_AddEP(1, USB_TRANSFER_TYPE_BULK, USB_MAX_PACKET_SIZE, NULL, 0);
  InitData.EPOut = USBD_AddEP(0, USB_TRANSFER_TYPE_BULK, USB_MAX_PACKET_SIZE, _abOutBuffer, USB_MAX_PACKET_SIZE);
  USBD_SetDeviceInfo(&_DeviceInfo);
  USB_MSD_Add(&InitData);
  //
  // Add logical unit 0:
  //
  memset(&InstData, 0,  sizeof(InstData));
  InstData.pAPI                    = &USB_MSD_StorageByName;    // s. Note (1)
  InstData.DriverData.pStart       = (void *)"";
  InstData.DriverData.pSectorBuffer   = _aSectorBuffer;
  InstData.DriverData.NumBytes4Buffer = sizeof(_aSectorBuffer);
  InstData.pLunInfo = &_Lun0Info;
  USB_MSD_AddUnit(&InstData);
}

/*********************************************************************
*
*       _ShowAniGIF
*/
static void _ShowAniGIF(const U8 * pData, unsigned NumBytes, int x, int y) {
  int                i;
  GUI_GIF_INFO       GifInfo   = {0};                                         // Info structure of GIF file
  GUI_GIF_IMAGE_INFO ImageInfo = {0};                                         // Info structure of one particular GIF image of the GIF file

  GUI_GIF_GetInfo(pData, NumBytes, &GifInfo);                                 // Get GIF info structure
  for (i = 0; i < GifInfo.NumImages; i++) {
    GUI_GIF_DrawSub(pData, NumBytes, x, y, i);                                // Draw sub image
    GUI_GIF_GetImageInfo(pData, NumBytes, &ImageInfo, i);       // Get sub image information
    GUI_Delay(ImageInfo.Delay ? ImageInfo.Delay * 10 : 10);                   // Use the Delay member of the ImageInfo structure for waiting a while
  }
}

/*********************************************************************
*
*       _GUITask
*/
static void _GUITask(void) {
  GUI_GIF_INFO Info;
  int          xSize;
  int          ySize;
  int          xPos;
  int          yPos;

  GUI_Init();
  xSize = LCD_GetXSize();
  ySize = LCD_GetYSize();
  if (ySize > xSize) {
    GUI_SetOrientation(GUI_SWAP_XY | GUI_MIRROR_Y);
  }
  GUI_SetBkColor(GUI_WHITE);
  GUI_SetColor(GUI_BLACK);
  GUI_SetFont(&GUI_Font20B_ASCII);
  while (1) {
    GUI_GIF_GetInfo(_aBusyWheelGIF, sizeof(_aBusyWheelGIF), &Info);
    GUI_Clear();
    GUI_SetTextAlign(GUI_TA_HCENTER | GUI_TA_VCENTER);
    xPos = xSize >> 1;
    yPos = (ySize >> 1) - (bmusb_image.YSize >> 1) - 15;
    GUI_GotoXY(xPos, yPos);
    GUI_DispString("USB Mass Storage Device sample");
    GUI_DrawBitmap(&bmusb_image, (xSize - bmusb_image.XSize) >> 1, (ySize - bmusb_image.YSize) >> 1);

    yPos = (ySize >> 1) + (bmusb_image.YSize >> 1) + 15;
    GUI_GotoXY(xPos, yPos);
    GUI_SetTextAlign(GUI_TA_HCENTER | GUI_TA_VCENTER);
    GUI_DispString("Waiting to be enumerated...");
    //
    // Wait for configuration
    //
    xPos  = (xSize - Info.xSize) >> 1;
    yPos += Info.ySize;
    while ((USBD_GetState() & (USB_STAT_CONFIGURED | USB_STAT_SUSPENDED)) != USB_STAT_CONFIGURED) {
      _ShowAniGIF(&_aBusyWheelGIF[0], sizeof(_aBusyWheelGIF), xPos, yPos);
    }
    GUI_GIF_GetInfo(_aLoaderBarGIF, sizeof(_aLoaderBarGIF), &Info);
    GUI_Clear();
    xPos = xSize >> 1;
    yPos = (ySize >> 1) - (bmusb_image.YSize >> 1) - 15;
    GUI_GotoXY(xPos, yPos);
    GUI_SetTextAlign(GUI_TA_HCENTER | GUI_TA_VCENTER);
    GUI_DispString("USB Mass Storage Device sample");

    xPos = (xSize >> 1) - 100 - bmDisplay.XSize;
    yPos = (ySize - bmDisplay.YSize) >> 1;
    GUI_DrawBitmap(&bmDisplay, xPos, yPos);
    xPos = (xSize >> 1) + 100;
    yPos = (ySize - bmHarddrive.YSize) >> 1;
    GUI_DrawBitmap(&bmHarddrive, xPos, yPos);

    xPos = xSize >> 1;
    yPos = (ySize >> 1) + (bmusb_image.YSize >> 1) + 15;
    GUI_GotoXY(xPos, yPos);
    GUI_SetTextAlign(GUI_TA_HCENTER | GUI_TA_VCENTER);
    GUI_DispString("Connected!");

    xPos = (xSize - Info.xSize) >> 1;
    yPos = (ySize - Info.ySize) >> 1;
    while (1) {
      if ((USBD_GetState() & (USB_STAT_CONFIGURED | USB_STAT_SUSPENDED)) != USB_STAT_CONFIGURED) {
        break;
      }
      _ShowAniGIF(&_aLoaderBarGIF[0], sizeof(_aLoaderBarGIF), xPos, yPos);
    }
  }
}

/*********************************************************************
*
*       Public code
*
**********************************************************************
*/
/*********************************************************************
*
*       MainTask
*
*/
void MainTask(void);
void MainTask(void) {
  OS_CREATETASK(&_GUITcb, "GUITask", _GUITask, 10, _aGUIStack);
  USB_Init();
  FS_Init();
  _FSTest();
  _AddMSD();
  USBD_Start();
  while (1) {
    //
    // Wait for configuration
    //
    while ((USBD_GetState() & (USB_STAT_CONFIGURED | USB_STAT_SUSPENDED)) != USB_STAT_CONFIGURED) {
      BSP_ToggleLED(0);
      USB_OS_Delay(50);
    }
    BSP_SetLED(0);
    USB_MSD_Task();
  }
}

